import { VALIDATE_RECIPIENT } from "../actions/action-types";

const recipientErrors = {
    errCount: 0,
    name: null,
    tin: null,
    street: null,
    city: null,
    state: null,
    zipcode: null,
    account: null
}

export default function recipientErrorReducer(state = recipientErrors, action) {
    switch( action.type ) {
        case VALIDATE_RECIPIENT: 
            return action.payload 

        default:
            return state;
    }
};
